import { createApp } from 'vue';
import App from './App.vue';
import './assets/css/custom.scss';

createApp(App).mount('#app');







window.vkAsyncInit = function() {
    VK.init({
      apiId: 51696427,
      access_token: 'vk1.a.mdU3En5xr5EdXXpQLp6ed7ggN-H8UhseWrf0vupNCX8ZF1L8Deoe2sCfWiwqQd0y16nurZo_3RR8SgP6OhZXDMUQSLFAGJJsuz-DyJSjxOoi1ZuzGF9UtI71TZ6uDlX9uYaa-5zZOfrbSisyL39Lm0j6FURqkImcwZXxZ-k1qYKn3Y6sWWu_bZqzhzkJJkFU'
    });
  };

  (function(d, s, id) {
    var js, fjs = d.getElementsByTagName(s)[0];
    if (d.getElementById(id)) return;
    js = d.createElement(s); js.id = id;
